export class Item{
    constructor(component, father, visible){
        this.component = component;
        this.father = father;
        this.visible = visible;
    }
}

export class Stack{
    constructor(){
        this.pilha = [];
    }

    empilha(item){
        this.pilha.push(item);
    }

    getPilha(){
        return this.pilha;
    }
}

var Pilha = new Stack();

export default Pilha;
